INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, 0, 1, 1.4, "お！\nあそこに困ってそうな人発見！", 0, "春咲 ひより", 2, 0, 1001);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, "みんなみたいに\nわたしも強くならなきゃ", 1, 0, 0, 1, 1.4, "大切な人を\n守れるようになりたい…って", 0, "草野 優衣", 2, 0, 1002);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "少しは磨かれると思いますよ。", 1, "フェンシングを始めてみては？", 1, 0, 0, 1, 1.4, "キミに必要な集中力と感性が", 0, "士条 怜", 2, 0, 1003);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "みそぎはねぇ、\nかくれんぼやりたい！", 1, "ねぇ、にいちゃん！", 1, 0, 0, 1, 1.5, "今日はなにして遊ぶ？", 0, "穂高 みそぎ", 2, 0, 1004);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "私といっしょに…\nいかない？", 1, "風宮あかりです", 1, 0, 0, 1, 1.4, "ねぇ…", 0, "風宮 あかり", 2, 0, 1006);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "食べ物の恨みは怖いのー", 1, "出雲宮子なのー", 1, 0, 0, 1, 1.5, "プリンたべたいのー", 0, "出雲 宮子", 2, 0, 1007);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "いいよ。\n見られることは運命さ…", 1, "ボクは虹村雪。", 1, 0, 0, 1, 1.4, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "虹村 雪", 2, 0, 1008);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "人呼んで「疾風の冥姫」!!", 1, "フッ…聞いて後悔するがいい！", 1, 0, 0, 1, 1.4, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "柊杏奈", 2, 0, 1009);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ほんまおおきにやわ～♪", 1, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, 0, 1, 1.5, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "姫宮 真歩", 2, 0, 1010);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ここで会ったが\n100年目～！", 1, "衣之咲璃乃です！", 1, 0, 0, 1, 1.4, "生き別れたお兄ちゃんを探して\n三千世界！", 0, "衣之咲 璃乃", 2, 0, 1011);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "…って、お願い！\n誰にも言わないでおいて～！", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, 0, 1, 1.4, "ち、超能力って…\n何のことかな～？", 0, "柏崎 初音", 2, 0, 1012);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, "ちょす！\n美波鈴奈だよ～♪", 1, 0, 0, 1, 1.4, "一応カリスマ読モJKやってまっす！", 0, "美波 鈴奈", 2, 0, 1016);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "でも、沖縄もとってもいいとこさー", 1, "はいたーい。\n喜屋武香織さー。", 1, 0, 0, 1, 1.4, "東京は遊園地みたいなところさー", 0, "喜屋武 香織", 2, 0, 1017);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "イオちゃんって呼んでね。", 1, "支倉伊緒です。", 1, 0, 0, 1, 1.4, "先生って呼ばれるのは\nくすぐったいから", 0, "支倉 伊緒", 2, 0, 1018);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ミミをおいてかないでぇ～", 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, 0, 1, 1.5, "あ！/\お兄ちゃ～ん\nまってよ～", 0, "茜 ミミ", 2, 0, 1020);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ふぇぇぇぇぇん……", 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, 0, 1, 1.5, "あの……\nふぇ……", 0, "栗林 くるみ", 2, 0, 1021);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "なんてありがとうございます！", 1, "風宮よりです。\nあああああ！", 1, 0, 0, 1, 1.4, "こんな私に貴重な時間を\n割いていただき、", 0, "風宮 より", 2, 0, 1022);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "私こっち行きたいー\nね、早く早くー", 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, 0, 1, 1.5, "おにいちゃんどこいくの？\nえ？", 0, "北条 綾音", 2, 0, 1023);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "これて何か違う…\nあああすみません！", 1, "わっ…わっ…私、\n天野すずめといいます！", 1, 0, 0, 1, 1.4, "ふ、不束者ですが\nどうぞ末永く…って、", 0, "天野 すずめ", 2, 0, 1025);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "離しませんわ………\n絶対に…!!", 1, "……クスクス…私は\n…倉石恵理子……", 1, 0, 0, 1, 1.4, "あなたは…運命の……\n伴侶……", 0, "倉石 恵理子", 2, 0, 1027);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "…そうでしょ？？", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, 0, 1, 1.4, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "佐々木 咲恋", 2, 0, 1028);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "あはは、\n私もまだまだだなぁ～", 1, "桜井望だよ！\nよろしくねっ", 1, 0, 0, 1, 1.4, "ぇっと…\nキミ、私のこと知らないの?!", 0, "桜井 望", 2, 0, 1029);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ショーグン、\nワタシと一緒に天下統一デース！", 1, "デケデケデンっ！", 1, 0, 0, 1, 1.4, "初めまして、\n私はニノン・ジュベール申すデス！", 0, "ニノン・ジュベール", 2, 0, 1030);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "おかしいですね……", 1, "上喜しのぶです。\n手元のドクロが父です。", 1, 0, 0, 1, 1.4, "でもって私の隣にいるのが……\nえ、見えない？", 0, "上喜 しのぶ", 2, 0, 1031);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そう、\nオラのボケに突っ込める相方が…！", 1, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, 0, 1, 1.5, "けんども\nそれには足りないモンが…", 0, "野戸まひる", 2, 0, 1033);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ちょ\nちょっと一杯飲んできます…！", 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, 0, 1, 1.4, "ちょっと緊張しちゃって…", 0, "綾瀬 ゆかり", 2, 0, 1034);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "これ以上お話しすることは…\nないです！", 1, "氷川鏡華…です", 1, 0, 0, 1, 1.5, "知らない人とは話しちゃいけないので", 0, "氷川 鏡華", 2, 0, 1036);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, "柏崎…栞です。", 1, 0, 0, 1, 1.4, "……あ、アラーム。", 0, "柏崎 栞", 2, 0, 1038);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "野に咲く花が、\n唯一の話相手です。", 1, "ふ、双葉碧です。", 1, 0, 0, 1, 1.4, "私、一人も友達がいなくて……", 0, "双葉 碧", 2, 0, 1040);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そう思っています。", 1, "三角千歌です。", 1, 0, 0, 1, 1.4, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "三角 千歌", 2, 0, 1042);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "う、疑ってすまなかったな…", 1, "安芸真琴だ。", 1, 0, 0, 1, 1.4, "あぁ？\nお前のそいつの仲間か？", 0, "安芸 真琴", 2, 0, 1043);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, "わらわこそは夜を総べる者！", 1, 0, 0, 1, 1.4, "生けとし生ける全ての者よ！", 0, "イリヤ・オーンスタイン", 2, 0, 1044);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "ｌク、クウカに何かご用ですか!?", 1, "そこで騎士は妖精を乱暴に……", 1, 0, 0, 1, 1.4, "ぐふふふふ……はっ！", 0, "遠見 空花", 2, 0, 1045);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "う～ん…\n猫ってホントに最高にゃ～♪", 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, 0, 1, 1.4, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "宮坂たまき", 2, 0, 1046);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, "大神美冬よ！", 1, 0, 0, 1, 1.4, "それでは早速クエストに…", 0, "大神 美冬", 2, 0, 1048);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, "星野静流だよ！", 1, 0, 0, 1, 1.4, "クエストもバトルも\n掃除も洗濯も", 0, "星野静流", 2, 0, 1049);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, "アタシは玉泉美咲。", 1, 0, 0, 1, 1.5, "見ての通りの\nセクシー美少女で", 0, "玉泉美咲", 2, 0, 1050);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "？？？？", 1, "？？？", 1, 0, 0, 1, 1.4, "？？？？", 0, "リマ", 2, 0, 1052);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 1, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィント", 2, 0, 1053);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 1, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0, "ペコリーヌ", 2, 0, 1058);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 1, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0, "コッコロ", 2, 0, 1059);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 1, 1.5, "菓子でつろうなどと\n稚拙な策を……", 0, "キャル", 2, 0, 1060);
